function EventoJugadorListItem({ event }) {
    return (
    <li>
        <a href={`/evento/${event._id}`}>{event.titulo}</a>
        <span>{event.lugar}</span>
        <hr />
    </li>
    );
}

export default EventoJugadorListItem;
